const projects = Array.from({ length: 50 }, (_, i) => ({
  id: i + 1,
  title: `Proyecto Impresionante ${i + 1}`,
  description: `Este proyecto revolucionó la industria ${i % 5 === 0 ? 'del diseño' : i % 3 === 0 ? 'tech' : 'creativa'} con su enfoque innovador.`,
  category: ['Diseño', 'Desarrollo', 'Branding', 'UX', 'Marketing'][i % 5],
  imageUrl: `https://source.unsplash.com/random/600x400/?project,${i}`
}));

export default projects;
